import Vue from "vue";
import App from "./App.vue";
import vuetify from "./plugins/vuetify";
import VueRouter from "vue-router";
import HomePage from "@/components/HomePage";
import ForSmallBusiness from "@/components/ForSmallBusiness";

Vue.config.productionTip = false;

Vue.use(VueRouter);

const ForEnterprise = { template: "<div>For Enterprise</div>" }; // Placeholder

const routes = [
  {
    path: "/for-small-business",
    name: "ForSmallBusiness",
    component: ForSmallBusiness,
  },
  { path: "/for-enterprise", component: ForEnterprise },
];

const router = new VueRouter({
  mode: "history",
  base: 'http://localhost:8080/',
  routes,
});

new Vue({
  vuetify,
  router,
  render: (h) => h(App),
}).$mount("#app");
